import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the price filter section using its heading text
    await page.waitForSelector('text=Price Range', { timeout: 5000 });

    // Use the label text to locate the min and max price inputs (by placeholder)
    const minPriceInput = await page.waitForSelector('input[placeholder="Min"]', { timeout: 5000 });
    const maxPriceInput = await page.waitForSelector('input[placeholder="Max"]', { timeout: 5000 });

    // Fill in the price range
    await minPriceInput.fill('100');
    await maxPriceInput.fill('500');

    // Take screenshot after entering values
    const step2 = path.join(screenshotsDir, 'step_2_price_entered.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Locate the "Apply" button using its text and click it
    const applyBtn = await page.waitForSelector('button:has-text("Apply")', { timeout: 5000 });
    await applyBtn.click();

    // Wait for a notification or for the product grid/list to update
    // We'll wait for the notification with text "Applied price filter" (if it appears)
    // If not, just wait for a short period for UI update
    try {
      await page.waitForSelector('.notification:has-text("Applied price filter")', { timeout: 2000 });
    } catch (e) {
      // Notification may not appear, ignore
    }

    // Take screenshot after applying filter
    const step3 = path.join(screenshotsDir, 'step_3_filter_applied.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract the min and max price values from the UI to verify
    const minValue = await page.$eval('input[placeholder="Min"]', el => el.value);
    const maxValue = await page.$eval('input[placeholder="Max"]', el => el.value);

    // Optionally, extract the number of products shown after filtering
    let resultsCount = null;
    try {
      // Try to find the results count element by its class or text
      const countElem = await page.$('.results-count');
      if (countElem) {
        resultsCount = await countElem.textContent();
      }
    } catch (e) {
      // Ignore if not found
    }

    return {
      success: true,
      action: "Applied price range filter (100 to 500) and verified UI update",
      extractedData: {
        minPrice: minValue,
        maxPrice: maxValue,
        resultsCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
